import Link from 'next/link';
import NavigationLink from './NavigationLink';

let Logo = (props) => {
	return (
			<img src={props.src} alt={props.alt || ''}  width={props.width}/>
	)
}



let MainNavigation = () => {
	let mainNavLink = [{name: 'Home', link: '/'},
						{name: 'About', link: '/about'},
						{name: 'FAQs', link: '/faq'},
					];
	return (
		<nav className="navbar is-transparent container">
			<div className="navbar-brand">
				<Link href="/">
					<a className="navbar-item">
						<Logo 
							src="/static/blockpeer-logo.png"
							alt="App logo"
							width=""
						/>
					</a>
				</Link>
				<div className="navbar-burger burger" data-target="mainNav">
			      <span></span>
			      <span></span>
			      <span></span>
			    </div>
			</div>

			<div id="mainNav" className="navbar-menu">
				<div className="navbar-end is-size-5">
					<NavigationLink 
						linkList={mainNavLink}
						classList="navbar-item is-tab"
					/>
				</div>
			</div>
		</nav>
	)
}

export default MainNavigation;
